import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { FaArrowLeft, FaEdit } from 'react-icons/fa';
import axios from 'axios';

const SwimSetsPage = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  const [swimSet, setSwimSet] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchSwimSet = async () => {
      try {
        setLoading(true);

        // Récupérer le token JWT stocké
        const token = localStorage.getItem('token') || sessionStorage.getItem('token');

        // Appel direct sans passer par le service api.js
        const response = await axios.get(`http://127.0.0.1:8000/api/swim-sets/${id}`, {
          headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
            'Authorization': token ? `Bearer ${token}` : ''
          },
          withCredentials: true
        });

        console.log('Réponse:', response.data);
        setSwimSet(response.data);
        setError(null);
        setLoading(false);
      } catch (err) {
        console.error('Erreur lors du chargement de la série:', err);
        setError(`Erreur lors du chargement de la série: ${err.message}`);
        setLoading(false);
      }
    };

    fetchSwimSet();
  }, [id]);

  const handleBack = () => {
    navigate('/admin/swim-sets');
  };

  const handleEdit = () => {
    navigate(`/admin/swim-sets/${id}/edit`);
  };

  if (loading) {
    return (
      <div className="container py-4">
        <div className="text-center">
          <div className="spinner-border text-primary" role="status">
            <span className="visually-hidden">Chargement...</span>
          </div>
          <p className="mt-3">Chargement des données...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container py-4">
        <div className="alert alert-danger" role="alert">
          {error}
        </div>
        <button 
          className="btn btn-outline-secondary" 
          onClick={handleBack}
        >
          <FaArrowLeft className="me-2" /> Retour à la liste
        </button>
      </div>
    );
  }

  if (!swimSet) {
    return (
      <div className="container py-4">
        <div className="alert alert-warning" role="alert">
          Série non trouvée
        </div>
        <button 
          className="btn btn-outline-secondary" 
          onClick={handleBack}
        >
          <FaArrowLeft className="me-2" /> Retour à la liste
        </button>
      </div>
    );
  }

  return (
    <div className="container py-4">
      <div className="card shadow mb-4">
        <div className="card-header bg-white">
          <div className="d-flex justify-content-between align-items-center">
            <div className="d-flex align-items-center">
              <button 
                className="btn btn-outline-secondary me-3" 
                onClick={handleBack}
              >
                <FaArrowLeft className="me-2" /> Retour
              </button>
              <div>
                <h5 className="mb-0">Détails de la Série</h5>
                <small className="text-muted">ID: {id}</small>
              </div>
            </div>
            <button
              className="btn btn-primary"
              onClick={handleEdit}
            >
              <FaEdit className="me-2" /> Modifier
            </button>
          </div>
        </div>

        <div className="card-body">
          <div className="row">
            <div className="col-md-6">
              <div className="card mb-3">
                <div className="card-header">
                  <h6 className="mb-0">Informations de base</h6>
                </div>
                <div className="card-body">
                  <dl className="row mb-0">
                    <dt className="col-sm-4">ID:</dt>
                    <dd className="col-sm-8">{swimSet.id}</dd>

                    <dt className="col-sm-4">Séance ID:</dt>
                    <dd className="col-sm-8">{swimSet.workout_id}</dd>

                    <dt className="col-sm-4">Exercice ID:</dt>
                    <dd className="col-sm-8">{swimSet.exercise_id}</dd>

                    <dt className="col-sm-4">Distance:</dt>
                    <dd className="col-sm-8">{swimSet.set_distance} m</dd>

                    <dt className="col-sm-4">Répétitions:</dt>
                    <dd className="col-sm-8">{swimSet.set_repetition || 1}</dd>

                    <dt className="col-sm-4">Temps de repos:</dt>
                    <dd className="col-sm-8">{swimSet.rest_time} secondes</dd>

                    <dt className="col-sm-4">Distance totale:</dt>
                    <dd className="col-sm-8">
                      <strong className="text-primary">
                        {(swimSet.set_distance || 0) * (swimSet.set_repetition || 1)} m
                      </strong>
                    </dd>
                  </dl>
                </div>
              </div>
            </div>

            <div className="col-md-6">
              <div className="card mb-3">
                <div className="card-header">
                  <h6 className="mb-0">Dates</h6>
                </div>
                <div className="card-body">
                  <dl className="row mb-0">
                    <dt className="col-sm-4">Créé le:</dt>
                    <dd className="col-sm-8">{new Date(swimSet.created_at).toLocaleString()}</dd>

                    <dt className="col-sm-4">Mis à jour le:</dt>
                    <dd className="col-sm-8">{new Date(swimSet.updated_at).toLocaleString()}</dd>
                  </dl>
                </div>
              </div>

              <div className="d-grid gap-2">
                <button 
                  className="btn btn-outline-primary"
                  onClick={() => navigate(`/admin/workouts/${swimSet.workout_id}`)}
                >
                  Voir la séance associée
                </button>
                <button 
                  className="btn btn-outline-secondary"
                  onClick={() => navigate(`/admin/exercises/${swimSet.exercise_id}`)}
                >
                  Voir l'exercice associé
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SwimSetsPage;
